import './UserForm.css';

import Card from '../Card'
import '../Card.css'
import { useState } from 'react';

<link rel="stylesheet" href="https://www.w3schools.com/w3css/4/w3.css"></link>

export default function UserForm(props) {

    let [enteredAge, setEnteredAge] = useState('');
    let [enteredName, setEnteredName] = useState('');



    const onSubmitHandler = () => {
        console.log("SUBMIT")
    }

    return (
        <form>
            <Card>
                <div className="new-user__control">
                    <label>Username</label>
                    <input type="text" value={enteredName}></input>
                </div>
                <div className="new-user__control">
                    <label>Age</label>
                    <input type="number" max={999} value={enteredAge}></input>
                </div>
                <div className="new-user__actions">
                    <button type="submit" className="bn3637 bn38" onSubmit={onSubmitHandler}><i>Add Expense</i></button>
                </div>
            </Card>
        </form>

    )

};
